import { GET_DATA, UPDATE_DATA } from '../Constant';


const initialState = {
    data:[],
}

export default function dataReducer(state = initialState, action) {

    switch(action.type) {
        case GET_DATA:
            return{
                ...state
            } 

        case UPDATE_DATA:
            return{
                ...state
            } 
        default:
            return state;
    }
}
